import * as React from "react"
import { SVGProps } from "react"

const HexComponent = (props: SVGProps<SVGSVGElement>) => (
  <svg
    xmlns="http://www.w3.org/2000/svg"
    height={300}
    xmlnsXlink="http://www.w3.org/1999/xlink"
    {...props}
  >
    <defs>
      <pattern
        id="a"
        x={0}
        y={0}
        height={300}
        width={300}
        patternUnits="userSpaceOnUse"
      >
        <image
          width={300}
          height={300}
          xlinkHref="http://placekitten.com/306/306"
        />
      </pattern>
    </defs>
    <path
      className="hex"
      fill="url('#a')"
      d="m300 150-75 130H75L0 150 75 20h150z"
    />
  </svg>
)

export default HexComponent
